import React from "react";
const SlotM=(props)=>{
    // let x='üòÑ';
    // let y='üòÑ';
    // let z='üéÖüèª';
    let x= props.x;
    let y= props.y;
    let z= props.z;
    if((x===y) && (y===z)){
        return(
            <>
            <div className="slot_inner">
            <h1> {" "} 
            {x} {y} {z}</h1>
            <h1>This is Matching.</h1>
            <br /></div>
            </>
        ) 
    }
    else{
        return(
            <>
            <div className="slot_inner">
            <h1> {" "} 
            {x} {y} {z}</h1>
            <h1>This is not  Matching.</h1>
            <br /></div>
            </>
        ) 

    }
}
export default SlotM;
